import logo from './logo.svg';
import './App.css';
import React from 'react';

function Btn(props) {
  return (
    <button style={{
      backgroundColor: "tomato",
      color: "white",
      padding: "10px 20px",
      border: 0,
      borderRadius: 10
    }}>{props.banana}</button>
  )
}

function App() {
  return (
    <div>
      <Btn banana="Save Changes"/>
      <Btn banana="Continue"/>
    </div>
  );
}

export default App;
